import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Set viewport to mobile size to trigger mobile menu
    await page.setViewportSize({ width: 375, height: 800 });

    // Wait for the nav menu button (mobile menu trigger)
    await page.waitForSelector('.nav-menu', { state: 'visible', timeout: 3000 });

    // Click the mobile menu button ("All")
    await page.click('.nav-menu');
    // Wait for the mobile menu overlay to appear
    await page.waitForSelector('#mobileMenuOverlay', { state: 'visible', timeout: 3000 });

    // Wait for the mobile menu to slide in (CSS transition)
    await page.waitForTimeout(400);

    // Take screenshot of mobile menu open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Extract all visible category links in the mobile menu
    const mobileMenuLinks = await page.$$eval(
      '#mobileMenuOverlay.show .mobile-menu a, .mobile-menu-overlay.show .mobile-menu a',
      els => els.map(e => e.textContent.trim()).filter(Boolean)
    );

    // Try to click a category link (e.g., "Electronics") in the mobile menu
    // Use XPath to find the first "Electronics" link inside the open mobile menu
    const [electronicsLink] = await page.$x("//div[contains(@class,'mobile-menu') and contains(@style,'')]//a[contains(.,'Electronics')] | //div[contains(@class,'mobile-menu')]/a[contains(.,'Electronics')]");
    if (electronicsLink) {
      await electronicsLink.click();
      // Wait for main content to update (simulate navigation delay)
      await page.waitForTimeout(800);
    }

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_category_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_category_selected.png'));

    // Close the mobile menu using the close button
    // Wait for the close button to be visible inside the overlay
    await page.waitForSelector('#mobileMenuOverlay.show .close-mobile-menu, .mobile-menu-overlay.show .close-mobile-menu', { timeout: 2000 });
    await page.click('#mobileMenuOverlay.show .close-mobile-menu, .mobile-menu-overlay.show .close-mobile-menu');

    // Wait for the overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay', { state: 'hidden', timeout: 2000 });

    // Take screenshot after closing mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    // Extract main content heading to verify navigation
    let headingText = '';
    try {
      headingText = await page.$eval('.category-results h2, .main-content h2, h2', el => el.textContent.trim());
    } catch {}

    return {
      success: true,
      action: "Tested mobile menu navigation: opened menu, extracted links, selected a category, closed menu, and verified navigation.",
      extractedData: {
        mobileMenuLinks,
        categoryHeading: headingText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
